import React from "react";
import "../../styles/compStyles/navbar.css";
export default props => {
    return (
        <>
            <div>

                <div clasName="nav"></div>
                <div className="intro">
                    <h1>navbar</h1>
                    <div className="navlogo" />
                </div>
            </div>
        </>
    )
}
